package aqqje.com.autowrite;public class Car {    private String brank;    private double pirce;    public Car() {    }    public Car(String brank, double pirce) {        this.brank = brank;        this.pirce = pirce;    }    public String getBrank() {        return brank;    }    public void setBrank(String brank) {        this.brank = brank;    }    public double getPirce() {        return pirce;    }    public void setPirce(double pirce) {        this.pirce = pirce;    }    @Override    public String toString() {        return "Car{" +                "brank='" + brank + '\'' +                ", pirce=" + pirce +                '}';    }}